import Layout from "../components/layout/layout";

function Register() {
  const position = { container: "w-3/5 md:5/12" };

  return (
    <Layout>
      <div className={position.container}>
        <h1>Eternal</h1>
      </div>
    </Layout>
  );
}

export default Register;
